import React from 'react'
import {makeStyles} from '@material-ui/core/styles'
import {Container, Typography, Tab, Tabs, Paper} from '@material-ui/core'

const useStyles = makeStyles(theme => ({
  root: {
    background: theme.palette.type === "light" ? theme.palette.background.light : theme.palette.background.dark,
    padding: theme.spacing(10),
  }
}))



function Projects() {
  const classes = useStyles()
  return (
    <Container justify="center" align="center" className={classes.root}>
      <Typography variant="h3" style={{textDecoration: "underline"}}>Projects</Typography>
      <Paper style={{flexGrow: 1}}>
        <Tabs value={0}>
          <Tab label="one" />
          <Tab label="two" />
          <Tab label="one" />
          <Tab label="two" />
        </Tabs>

      </Paper>
    </Container>
  )
}

export default Projects
